import React, { useState } from 'react';

import { Input } from 'antd';
const { Search } = Input;

function Searchbar() {
  const [value, setValue] = useState(0);

  return (
    <React.Fragment>
      <Search
        placeholder="input search text"
        enterButton="Search"
        size="large"
        onSearch={(value) => console.log(value)}
        style={{ width: '500rem' }}
      />
    </React.Fragment>
  );
}

export default Searchbar;
